import React, { Component } from "react";
import TodoDelete from "./TodoDelete"

class TodoItem extends Component {
    state = {
        clients: []
      };

    render () {
        return(
            <div className="card">
            <ul>
              {this.state.clients.map(client => (
                <TodoDelete
                  key={client.id}
                  details={client}
                  onDelete={this.handleDelete}
                />
              ))}
            </ul>
          </div>
        )
    }
}

export default TodoItem;
